--Procedure to return status counts for all existing clients
create or replace PROCEDURE GET_ALLCLIENTS_STATUS_COUNT 
(
  STATUS_ID IN VARCHAR2, 
OutputParam OUT NUMBER 
) 
AS 
BEGIN
--OutputParam := select count(*)
select count(*) into OutputParam
from
(select 
A.TF_MARKETING_STATUS_NAME,
 C.TF_CLIENT_NAME
from
(select A.TF_ASSOCIATE_ID,
 M.TF_MARKETING_STATUS_NAME
from ADMIN.TF_ASSOCIATE A
inner join 
ADMIN.TF_MARKETING_STATUS M
  on 
A.TF_MARKETING_STATUS_ID = M.TF_MARKETING_STATUS_ID
where M.TF_MARKETING_STATUS_ID = STATUS_ID) A
inner join
  (select A.TF_ASSOCIATE_ID, C.TF_CLIENT_NAME
  from ADMIN.TF_BATCH B
inner join ADMIN.TF_ASSOCIATE A
  on B.TF_BATCH_ID = A.TF_BATCH_ID
inner join ADMIN.TF_CLIENT C
  on B.TF_CLIENT_ID = C.TF_CLIENT_ID) C
on A.TF_ASSOCIATE_ID = C.TF_ASSOCIATE_ID);
END GET_ALLCLIENTS_STATUS_COUNT;
/


--procedure selecting status counts for specific clients
create or replace PROCEDURE       GET_CLIENT_STATUS_COUNT 
(
  CLIENT_ID IN VARCHAR2 
, STATUS_ID IN VARCHAR2 
, OutputParam OUT NUMBER 
) AS 
BEGIN
  select count(*) into OutputParam
from
(select A.TF_MARKETING_STATUS_NAME, C.TF_CLIENT_NAME
from
(select A.TF_ASSOCIATE_ID, M.TF_MARKETING_STATUS_NAME
  from ADMIN.TF_ASSOCIATE A
  inner join ADMIN.TF_MARKETING_STATUS M
  on A.TF_MARKETING_STATUS_ID = M.TF_MARKETING_STATUS_ID
  where M.TF_MARKETING_STATUS_ID = STATUS_ID) A
  inner join
  (select A.TF_ASSOCIATE_ID, C.TF_CLIENT_NAME
  from ADMIN.TF_BATCH B
  inner join ADMIN.TF_ASSOCIATE A
  on B.TF_BATCH_ID = A.TF_BATCH_ID
  inner join ADMIN.TF_CLIENT C
  on B.TF_CLIENT_ID = C.TF_CLIENT_ID
  where C.TF_CLIENT_ID = CLIENT_ID) C
on A.TF_ASSOCIATE_ID = C.TF_ASSOCIATE_ID);
END GET_CLIENT_STATUS_COUNT;
/

--Procedure to take in date strings s MM-YYYY-DD and return batch info that exist or have existed in that
--time range in a cursor
create or replace PROCEDURE batch_by_date_range_PROC 
(
  Start_Range IN VARCHAR2 
, End_Range IN VARCHAR2 
, OutputCursor OUT sys_refcursor
) AS
BEGIN
OPEN OutputCursor FOR
select tf_batch_id, tf_batch_name, tf_batch_start_date, tf_batch_end_date,
tf_client_id, tf_curriculum_id, tf_batch_location_id from
admin.tf_batch
where TO_TIMESTAMP(Start_Range, 'MM-YYYY-DD') <= tf_batch_end_date
AND  TO_TIMESTAMP(End_Range, 'MM-YYYY-DD')  >= tf_batch_start_date 
order by tf_batch_start_date;

END batch_by_date_range_PROC;
/

--procedure to return batch info based off of specific name
create or replace PROCEDURE batch_by_name 
(
  batch_name_in IN VARCHAR2 
, OutputCursor OUT sys_refcursor
) AS
BEGIN
OPEN OutputCursor FOR
select tf_batch_id, tf_batch_name, tf_batch_start_date, tf_batch_end_date,
tf_client_id, tf_curriculum_id, tf_batch_location_id from
tf_batch
where tf_batch_name = batch_name_in
order by tf_batch_name;
END batch_by_name;

--procedure to delete all info from tables under dev role, to be accessed via button in application
CREATE OR REPLACE PROCEDURE truncateAllDevTeam
as
BEGIN
execute immediate 'delete from admin.tf_interview';
execute immediate 'delete from admin.TF_PLACEMENT';
execute immediate 'delete from admin.TF_ASSOCIATE';

execute immediate 'delete from admin.TF_BATCH';
execute immediate 'delete from admin.TF_INTERVIEW_TYPE';
execute immediate 'delete from admin.TF_BATCH_LOCATION';
execute immediate 'delete from admin.TF_MARKETING_STATUS';
execute immediate 'delete from admin.TF_curriculum';
execute immediate 'delete from admin.TF_CLIENT';
execute immediate 'delete from admin.TF_END_CLIENT';
commit;
END truncateAllDevTeam;
/

--procedure for admin purpose testing to delete all info in tables
CREATE OR REPLACE PROCEDURE truncateAll
as
BEGIN
execute immediate 'delete from tf_interview';
execute immediate 'delete from TF_PLACEMENT';
