execute immediate 'delete from TF_BATCH';
execute immediate 'delete from TF_INTERVIEW_TYPE';
execute immediate 'delete from TF_BATCH_LOCATION';
execute immediate 'delete from TF_MARKETING_STATUS';
execute immediate 'delete from TF_curriculum';
execute immediate 'delete from TF_CLIENT';
execute immediate 'delete from TF_END_CLIENT';
commit;
END truncateAll;
/


